const uniTokenAddress = '0x1f9840a85d5af5bf1d1762f925bdaddc4201f984';



// Function to implement a SWAP of ETH for another ERC-20 token ( UNI )
export const swap = async () => {

	// Account setup with Metamask, Ethers.js and Web3
	const accounts = await window.web3.eth.getAccounts(); 
	const account = accounts[0];
	const provider = new ethers.providers.Web3Provider(window.ethereum);
	const signer = provider.getSigner(account);

	// Initialize UNI token object
	// By default will connect to MAINNET, can change by passing in a different etherJS provider 
	const uni = await Fetcher.fetchTokenData(chainId, uniTokenAddress, provider);

    // Initilize WETH token object 
    const weth = WETH[chainId];

    // Initilize UNI/WETH PAIR (Order does not matter)
    const pair = await Fetcher.fetchPairData(uni, weth);

    // Initialize route
    // Can pass in multiple pairs in the array if you want to synthically create markets that don't exist
    // We passed weth as input token which means we are interested in weth => uni trade
    const route = new Route([pair], weth);

	// Initilize trade object to contain trade details  
    const trade = new Trade(route, new TokenAmount(weth,'1000000000000000000'), TradeType.EXACT_INPUT);
 
    // Prepare parameters for swapExactETHForToken function to execute trade (UniswapV2Router02 contract)
    const slippageTolerance = new Percent('50', '10000');
    const amountOutMin = trade.minimumAmountOut(slippageTolerance).raw;
    const path = [weth.address, uni.address];
    const deadline = Math.floor(Date.now()/100) + 60 * 20; // 20 mins from trade initiation
    const value = trade.inputAmount.raw;  

    try { 

		// create instance of Uniswap V2 router
		const uniswap =  new ethers.Contract('0x7a250d5630B4cF539739dF2C5dAcb4c659F2488D',abi, signer);

		// send transaction to network to be mined
        const tx = await uniswap.swapExactETHForTokens(
            String(amountOutMin),
            path,
            account,
            deadline,
            {value: String(value), gasPrice: 20e9, gasLimit: 250000 }
        );
        console.log(`Transaction hash: ${tx.hash}`)

		// mine transaction
		const receipt = await tx.wait();
		console.log(`Block number: ${receipt.blockNumber}`)

    } catch(err) {
        console.log(err.message)
    }
    
    


}

